import React, { Component } from 'react';
import Product from './Product';
import axios from 'axios';

class AllProducts extends Component{
	state = {
		'ids':[{'id':1},{'id':2}],
		'err':'No error',
		'data':'ref.data',
	}
	componenetDidMount(){
		axios.get('http://127.0.0.1:8000/productList').then(ref=>{
			this.setState({'data':ref.data});
		}).catch(err=>{
			console.log({'err':err});
		});
	}
	render(){
		return(
			<div className='cotainer'>
				{this.state.ids.map((d)=>{return(
					<div className='container' key={d.id}>	
						<Product
						ProductName='Goldy T-Shirt'
						Likes={d.id}
						Comments='2'
						Dislikes='0'
						onClick={()=>this.props.onClick(d.id)}
						/>
					</div>
				)})}
				<div>
					{this.state.data}
				</div>
			</div>
		);
	}
}

export default AllProducts;
